import React from "react";
import prueba from './components/prueba';
import {BrowserRouter as Router, Routes, Route} from "react-router-dom";


function App() {
  return (
    <div>
      <Router>
        <prueba>
        <Routes>
          <Route path="/prueba" component={prueba} />
        </Routes>
        </prueba>
      </Router>
    </div>
    
  );
}

export default App;
